#include <iostream>
#include <vector>
using namespace std;

/*
 * 给你一个字符串 s，最多 可以从中删除一个字符。
 * 请你判断 s 是否能成为回文字符串：如果能，返回 true ；否则，返回 false 。
 *
 * 双指针，遇到第一个不符合要求的对称时，存在删除左还是删除右的问题
 */
class Solution {
  public:
    bool has_deleted = false;
    bool validPalindromeSubStr(string& s, int start, int end) {
        if (start == end) {  // 单字符-> true
            return true;
        } else if (start + 1 == end && s[start] == s[end]) {  // 相等的两个字符->true
            return true;
        } else if (start + 1 == end && s[start] != s[end]) {  // 不相等的两个字符
            if (!has_deleted) {                               // 还有机会删除一个字符-> true
                return true;
            } else {
                return false;  // 没有机会删除字符了 -> false
            }
        } else {                       // 大于两个字符的情况
            if (s[start] == s[end]) {  // 当前字符相等
                if (!has_deleted) {    // 还有机会删除字符, 以下满足一个true即可
                    if (validPalindromeSubStr(s, start + 1, end - 1)) {
                        return true;
                    }
                    has_deleted = true;
                    if (validPalindromeSubStr(s, start, end - 1) || validPalindromeSubStr(s, start + 1, end)) {
                        return true;
                    }
                    has_deleted = false;
                    return false;
                } else {  // 没有机会删除字符了
                    if (validPalindromeSubStr(s, start + 1, end - 1)) {
                        return true;
                    } else {
                        return false;
                    }
                }
            } else {                // 当前字符不相等
                if (has_deleted) {  // 没有机会删除字符了
                    return false;
                } else {  // 还有机会删除字符
                    has_deleted = true;
                    if (validPalindromeSubStr(s, start, end - 1) || validPalindromeSubStr(s, start + 1, end)) {
                        return true;
                    }
                    has_deleted = false;
                    return false;
                }
            }
        }
    }

    bool validPalindrome(string s) {
        has_deleted = false;
        if (s.size() <= 1) {
            return true;
        }
        return validPalindromeSubStr(s, 0, s.size() - 1);
    }
};

